import React from 'react';
import Slider from '../../HOMEPAGE/slideShow/slideShow.component';
import './slideParent.style.css'

class SliderParent extends React.Component {
	render() {
  let data = [
			'Apple',
			'Ball',
			'Cat',
			'Dog',
			'Elephant',
			'Fruits',
			'Gorilla',
			'Horse',
			'Ink',
			'Jug',
			'Kite',
			'Lemon',
			'Orange',
			'Paddy',
			'Queen',
			'Rose',
			'Street',
			'Tuesday',
			'Umbrella',
			'Vanilla',
			'Wax',
			'Xerox',
			'Yarn',
			'Zebra'
		];
		return (
			<div className='parent'>
				<Slider>
					{data.map(value => {
						return (
							<div key={value} className='child'>
								{value}
							</div>
						);
					})}
				</Slider>
			</div>
		);
	}
}

export default SliderParent;
